import { compile, compileCode} from './compiler.js';

// Initialise window.DTLSfuncBroadcast
window.DTLSfuncBroadcast = {
  func: null,
  args: {}
};

function updateDTLSfuncBroadcast(FUNCTION, ...args) {
  window.DTLSfuncBroadcast = {
    func: FUNCTION,
    args: {}
  };
  args.forEach((arg, index) => {
    window.DTLSfuncBroadcast.args[`args${index + 1}`] = arg;
  });
  console.log("Updated DTLSfuncBroadcast:", window.DTLSfuncBroadcast);
}

function preupdateDTLSfuncBroadcast(FUNCTION, ARGS) {
  const argsArray = ARGS.split(",").map((arg) => {
    try {
      return JSON.parse(arg);
    } catch (e) {
      return arg.trim();
    }
  });
  updateDTLSfuncBroadcast(FUNCTION, ...argsArray);
}

